import React from 'react';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';
import AppStyled from './AppStyled';  // Supposons que c'est votre composant de style général
import Dashboard from '../Components/Dashboard/Dashboard';
import Income from '../Components/Income/Income';
import Expenses from '../Components/Expenses/Expenses';
import Register from '../Components/auth/register';

const router = createBrowserRouter([
  {
    path: "/",
    element: <AppStyled><Dashboard /></AppStyled>
  },
  {
    path: "/income",
    element: <AppStyled><Income /></AppStyled>
  },
  {
    path: "/expenses",
    element: <AppStyled><Expenses /></AppStyled>
  },
  {
    path: "/register",
    element: <Register />  // Register peut avoir son propre style ou layout si nécessaire
  },
]);

export default function AppRouter() {
  return <RouterProvider router={router} />;
}
